css:
.current-file-breadcrumb {
  height: 33px;
  /* DARK COLORS */
}
.current-file-breadcrumb .breadcrumb,
.current-file-breadcrumb .breadcrumb a {
  height: 33px;
  display: inline-block;
}
.current-file-breadcrumb .breadcrumb {
  margin: 0;
  padding: 0;
  border-radius: 3px;
  border-width: 1px;
  border-style: solid;
  overflow: hidden;
}
.current-file-breadcrumb .breadcrumb a {
  text-rendering: optimizeLegibility;
  line-height: 33px;
  font-size: 12px;
  font-weight: 300;
  text-decoration: none;
  padding: 0 10px 0 20px;
  position: relative;
}
.current-file-breadcrumb .breadcrumb a:first-child {
  padding-left: 16px;
}
.current-file-breadcrumb .breadcrumb a:last-child,
.current-file-breadcrumb .breadcrumb input[type=text] {
  padding-right: 16px;
}
.current-file-breadcrumb .breadcrumb a:after,
.current-file-breadcrumb .breadcrumb a:before {
  content: '';
  display: block;
  width: 0;
  height: 0;
  border-top: 17px solid transparent;
  border-bottom: 17px solid transparent;
  /* make left half the height */
  border-left: 10px solid transparent;
  position: absolute;
  margin: auto;
  top: 0;
  bottom: 0;
  left: 100%;
  z-index: 2;
}
.current-file-breadcrumb .breadcrumb a:before {
  margin-left: 1px;
  z-index: 1;
}
.current-file-breadcrumb .breadcrumb a:last-child {
  color: #fff;
}
.current-file-breadcrumb .breadcrumb a:last-child {
  pointer-events: none;
  cursor: default;
}
.current-file-breadcrumb .breadcrumb a:last-child:after,
.current-file-breadcrumb .breadcrumb a:last-child:before,
.current-file-breadcrumb .breadcrumb input[type=text] {
  border: none;
}
.current-file-breadcrumb .breadcrumb input[type=text] {
  -webkit-appearance: none;
  display: inline-block;
  text-indent: 24px;
  padding: 0 16px;
  height: 33px;
  width: 10px;
  outline: 1px solid transparent;
  background-origin: content-box;
  background-position: left 50%;
  background-repeat: no-repeat;
  background-size: 15px 15px;
  transition-property: all;
  transition-duration: .13s;
  transition-timing-function: cubic-bezier(0.455, 0.03, 0.515, 0.955);
}
.current-file-breadcrumb .breadcrumb input[type=text]:hover,
.current-file-breadcrumb .breadcrumb input[type=text]:focus {
  width: 100px;
}
.current-file-breadcrumb .breadcrumb {
  border-color: #2E3031;
}
.current-file-breadcrumb .breadcrumb a {
  color: #c6c6c6;
  background-color: #595B5B;
  text-shadow: 0 -1px rgba(0, 0, 0, 0.7);
  box-shadow: inset 0 1px 0 #727373;
}
.current-file-breadcrumb .breadcrumb a:after {
  border-left-color: #595B5B;
}
.current-file-breadcrumb .breadcrumb a:before {
  border-left-color: #2E3031;
}
.current-file-breadcrumb .breadcrumb a:hover {
  background: #646666;
}
.current-file-breadcrumb .breadcrumb a:hover:after {
  border-left-color: #646666;
}
.current-file-breadcrumb .breadcrumb a:active:before {
  border-left-color: #404141;
}
.current-file-breadcrumb .breadcrumb a:last-child,
.current-file-breadcrumb .breadcrumb input[type=text] {
  background-color: #404141;
  box-shadow: inset 0 1px 2px rgba(0, 0, 0, 0.2);
}
.current-file-breadcrumb .breadcrumb input[type=text] {
  color: #c6c6c6;
  background-image: url(https://s3-us-west-2.amazonaws.com/s.cdpn.io/49364/search-light.svg);
}
.current-file-breadcrumb .breadcrumb input[type=text]:focus {
  outline-color: #0026FF;
  background-color: #fff;
  box-shadow: inset 0 0 0 2px #6cb4f3, inset 0 1px 2px rgba(0, 0, 0, 0.4);
}
